import * as React from "react";
import Button from "@mui/material/Button";

function App() {
  return (
    <div className="App">
      <Button variant="text">Text</Button>
      <Button disabled variant="contained">
        Contained
      </Button>
      <Button  href="www" variant="outlined">Outlined</Button>
    </div>
  );
}

export default App;
